import React from 'react'
import { Link } from 'react-router-dom';
import UserService from '../service/UserService';

function Landing() {
  return (
    <div className='d-grid gap-2' >
      <h2>Users Landing Page</h2>
      <button type="button" class="btn btn-primary">Add User</button>
      <button type="button" class="btn btn-primary">Export to Excel</button>
      <button type="button" class="btn btn-primary">Export to pdf</button>
      <button type="button" class="btn btn-primary">Export to csv</button>
      <button type="button" class="btn btn-primary">View Users</button>
    </div>
  )
}

export default Landing
